window.bookSummaryJSON = "<p>In a world where magic is real, Alex is about to learn that being shot in the head was only the beginning. God has given him a choice: to take the life of the person meant to die that day and forget who he was, or to keep being Alex and transition to a world of magic where God would give him the tools to survive. Alex, an avid fan of fantasy, chooses the latter and is thrown through a black portal into a world he never could have imagined.</p> <p>Once there, he discovers that he has the ability to wield all five Elemental magics: earth, fire, water, air, and mind. But the power is changing him, and he is quickly learning that his title as \"The Elemental Summoner\" is feared by everyone in the world of Boromour. Every thousand years, an Elemental Summoner is born who can wield all five Elemental magics and usually ends up destroying everything around them in their quest for power. Alex must learn to control his powers before it's too late.</p> <p>As he navigates this new world, Alex meets sexy, powerful monster girls who may be able to help him control his power and keep him from becoming evil. But as he learns more about Boromour and the dangers that come with his powers, he realizes that the stakes are higher than he could have ever imagined.</p> <p>This blockbuster series is full of adventure, magic, mayhem, and monster girls with fluffy tails. Will Alex be able to harness his power and save the world of Boromour, or will he succumb to the same fate as his predecessors?</p>"; 
